import React, { Component } from 'react'

import '../../normalize.scss'
import '../../base.scss'
import ComponentPerfil from '../../components/Perfil/PerfilUsuario/index'
import View from "../view/view"


class Perfil extends Component {
  render() {
    return (
      <View public={true}>
        <ComponentPerfil />
      </View>
    )
  }
}

export default Perfil;
